import React from "react";
import { useNavigate } from "react-router-dom"; // Import useNavigate hook from react-router-dom

const HomePage = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear any user session or authentication tokens (if stored in localStorage)
    localStorage.removeItem("authToken"); // Example: remove the auth token from localStorage

    // Optional: If you're using sessionStorage
    // sessionStorage.removeItem("authToken");

    // Redirect to login page after logging out
    navigate("/login"); // Assuming you have a route for login

    // If you need to make an API call for logging out, you can do that here
    // For example, using axios:
    // axios.post('/api/logout').then(response => {
    //   console.log("User logged out.");
    // }).catch(error => {
    //   console.error("Error logging out:", error);
    // });
  };

  return (
    <div className="page-content">
      <h1>Welcome to Digitalflake Admin</h1>
      <button className="logout-btn" onClick={handleLogout}>
        Logout
      </button>
    </div>
  );
};

export default HomePage;
